const groupListData = {
  countList: [
    { combination: ['스몰', '검정', '선물포장'], remainCount: 0 },
    { combination: ['스몰', '검정', '포장안함'], remainCount: 0 },
    { combination: ['스몰', '하양', '선물포장'], remainCount: 0 },
    { combination: ['스몰', '하양', '포장안함'], remainCount: 0 },
    { combination: ['스몰', '빨강', '선물포장'], remainCount: 0 },
    { combination: ['스몰', '빨강', '포장안함'], remainCount: 0 },
    { combination: ['라지', '검정', '선물포장'], remainCount: 5 },
    { combination: ['라지', '검정', '포장안함'], remainCount: 5 },
    { combination: ['라지', '하양', '선물포장'], remainCount: 0 },
    { combination: ['라지', '하양', '포장안함'], remainCount: 0 },
    { combination: ['라지', '빨강', '선물포장'], remainCount: 1 },
    { combination: ['라지', '빨강', '포장안함'], remainCount: 1 },
  ],
  titleList: ['사이즈', '색상', '포장'],
  groupList: [
    { title: '사이즈', options: ['스몰', '라지'] },
    { title: '색상', options: ['검정', '하양', '빨강'] },
    { title: '포장', options: ['선물 포장', '포장 안함'] },
  ],
};

module.exports = groupListData;

